چالاککرا:','Add prices'=>'زیادکردنی نرخەکان','Add price to all variations that don\'t have a price'=>'زیادکردنی نرخ بۆ سەرجەم ئەو گۆڕانکارییانەی نرخیان نییە','We recently asked you if you wanted more information about WooPayments. Run your business and manage your payments in one place with the solution built and supported by WooCommerce.'=>'بەم دواییە پرسیارمان لێ کردیت ئایا دەتەوێت زانیاریی زیاتر لەسەر (WooPayments) وەربگریت. کارەکەت و پارەدانەکانت ڕێکبخە لەیەک جێگا لەگەڵ چارەسەرێکی گونجاو و بەهێز کە دروستکراوە و پشتگیریی دەکرێت لەلایەن (WooCommerce).','List of attributes (taxonomy terms) assigned to the product. For variable products, these are mapped to variations (see the `variations` field).'=>'لیستەی تایبەتمەندییەکان (زاراوەکانی پۆلێنکردن) کە سپێردراون بە بەرهەمەکە. بۆ بەرهەمی گۆڕاو، ئەمانە نەخشەیان بۆ دانراوە بۆ گۆڕانکارییەکان (تەماشای خانەی `گۆڕانکارییەکان` بکە).','Datastore currently in use for orders.'=>'لە ئێستادا کۆگای دراوە (Datastore) بەکاردەهێنرێت بۆ داواکارییەکان.','Order datastore:'=>'کۆگای دراوەی داواکاری:','Filter by rating'=>'پاڵاوتن بەپێی هەڵسەنگاندن','block titleFilter by Stock Controls'=>'پاڵاوتن بەپێی کۆنترۆڵەکانی کۆگا','block descriptionEnable customers to filter the product grid by rating.'=>'ڕێگە بە کڕیاران بدە بۆ پاڵاوتنی خانەخانەی بەرهەمەکە بە پێی هەڵسەنگاندن.','block titleFilter by Price Controls'=>'پاڵاوتن بەپێی کۆنترۆڵەکانی نرخ','block descriptionShows the Cross-Sells products.'=>'بەرهەمە فرۆش-یەکتربڕەکان پیشدان دەدات.','block titleCart Cross-Sells Products'=>'سەبەتەی بەرهەمە فرۆش-یەکتربڕەکان','block descriptionShows the Cross-Sells block.'=>'بڵۆکی فرۆش-یەکتربڕەکان پیشدان دەدات.','block titleCart Cross-Sells'=>'سەبەتەی فرۆش-یەکتربڕەکان','block titleFilter by Attribute Controls'=>'پاڵاوتن بەپێی کۆنترۆڵەکانی تایبەتمەندییەکان','You may be interested in…'=>'لەوانەیە تۆ ئارەزوو بکەیت...','Product quantity'=>'بڕی بەرهەم','Incompatible with \'%s\''=>'نەگونجاوە لەگەڵ \'%s\'','Incompatible with WooCommerce features'=>'نەگونجاوە لەگەڵ 