یبەتمەندییانەی لەژێر تاقیکردنەوەدان','%1$s should be called inside the %2$s action.'=>'%1$s دەبێت بانگ بکرێت لەناو کرداری %2$s','Missing table info for query arg.'=>'زانیاریی خشتە بۆ داواکاریی دیار نییە.','Create ad campaigns and reach one billion global users with %1$sTikTok for WooCommerce%2$s'=>'کەمپینی بانگەشە دروست بکە و بیگەیەنە بە ملیاران کەس لەگەڵ %1$sTikTok بۆ WooCommerce%2$s','Migrate command is deprecated. Please use `sync` instead.'=>'کۆچکردنی فرمان بەسەرچووە. تکایە `sync` بەکاربهێنە.','Sync completed.'=>'هاوکاتگەریی کۆتایی هات.','No orders were synced.'=>'هیچ داواکارییەک هاوکات نەکرا.','block titleFilter Block'=>'بڵۆکی پاڵاوتن','block descriptionEnable customers to filter the product grid by choosing a price range.'=>'ڕێگە بە کڕیاران بدە بۆ پاڵاوتنی خانەخانەی بەرهەمەکە بە هەڵبژاردنی ماوەی نرخ.','block descriptionEnable customers to filter the product grid by stock status.'=>'ڕێگە بە کڕیاران بدە بۆ پاڵاوتنی خانەخانەی بەرهەمەکە بە پێی دۆخی کۆگا.','block descriptionContains blocks that display the content of the Mini-Cart.'=>'ئەو بڵۆکانە لەخۆدەگرێت کە ناوەڕۆکی (Mini-Cart)ەکە پیشان دەدات.','block descriptionHighlight a product or variation.'=>'بە گرنگ پیشاندانی بەرهەم یان گۆڕانکارییەک.','block descriptionEnable customers to filter the product grid by selecting one or more attributes, such as color.'=>'ڕێگە بە کڕیاران بدە پاڵاوتن بۆ خانەخانەی بەرهەمەکە بکەن بە دیاریکردنی تایبەتمەندییەک یان زیاتر، وەکو ڕەنگ.','block descriptionDisplay the currently active filters.'=>'پیشاندانی ئەو پاڵاوتنانەی ئێستا چالاک کراون.','Process your orders on the go. %1$sGet the app%2$s.'=>'بەئاسانیی داواکارییەکانت بەڕێوەببە. %1$sبەرنامە بەکاربەرییەکە بەدەست بهێنە%2$s.','%1$sManage the order%2$s with the app.'=>'%1$sبەڕێوەبردنی داواکارییەکە%2$s لەگەڵ بەرنامە بەکاربەرییەکە.','%1$sCollect payments easily%2$s from your customers anywhere with our mobile app.'=>'%1$sبەئاسانیی پارە وەربگرە%2$s لە کڕیارانت لەگەڵ بەرنامە بەکاربەرییەکەمان.','Something went wrong when trying to restore order %d from the trash. It could not be restored.'=>'هەڵەیەک ڕوویدا لەکاتی گەڕاندنەوەی داواکاریی %d لە تەنەکەی خۆڵەکەوە. نەتوانرا بگەڕێندرێتەوە.','The previous status of order %1$d ("%2$s") is invalid. It could not be restored.'=>'دۆخی پێشووی داواکاریی %1$d ("%2$s") نادروستە. نەتوانرا بگەڕێندرێتەوە.','The previous status of order %1$d ("%2$s") is invalid. It has been restored to "pending" status instead.'=>'دۆخی پێشووی داواکاریی %1$d ("%2$s") نادروستە. گەڕێنرایەوە بۆ دۆخی "چاوەڕوانی".','Order %1$d cannot be restored from the trash: it has already been restored to status "%2$s".'=>'نەتوانرا داواکاریی %1$d بگەڕێندرێتەوە لە تەنەکەی خۆڵەکەوە: خۆی گەڕێندراوەتەوە بۆ دۆخی "%2$s".','Get the free WooCommerce mobile app'=>'بەرنامەی بەکاربەریی بێبەرانبەری (WooCommerce) بەدەست بهێنە','Whether or not this store country is set via onboarding profiler.'=>'ئایا وڵاتی ئەم فرۆشگایە لەلایەن پرۆفایلەرەوە دانراوە یان نا.','Registers whether the note is read or not'=>'تۆماردەکرێت جا تێبینییەکە خوێنرابێتەوە یان نا','Jetpack is not connected.'=>'(Jetpack) پەیوەست نییە.','“New Account” emails are sent when a customer signs up via the checkout flow.'=>'پۆستی ئەلیکترۆنییەکانی “هەژماری نوێ“ نێردراون کاتێک کڕیارێک خۆی تۆمارکردووە لەڕێگەی فۆڕمی پارەدانەکەوە.','Empty Mini-Cart Message'=>'نامەی (Mini-Cart)ی بەتاڵ','Ensure meta_data excludes specific keys.'=>'دڵنیابەرەوە meta_data کلیلە تایبەت و دیاریکراوەکان بەدەر دەکات.','Limit meta_data to specific keys.'=>'سنووردارکردنی meta_data بۆ کلیلە تایبەت و دیاریکراوەکان','Unsupported argument type provided as value.'=>'جۆری بەڵگەیەکی پشتگیریی نەکراو پێشکەشکراوە وەکو بەها.','Invalid password. Generate a new one from %s.'=>'تێپەڕەوشەی نادروست. دانەیەکی نوێ دروست بکە لە %s.','Connection password:'=>'تێپەڕەوشەی پەیوەندی:','If you don\'t have an application password (not your account password), generate a password from %s'=>'ئەگەر تێپەڕەوشەی بەرنامەی بەکاربەرییت نییە (مەبەستمان تێپەڕەوشەی هەژمارەکەت نییە)، تێپەڕەوشەیەک دروست بکە لە %s','Your store is already connected.'=>'فرۆشگاکەت خۆی پەیوەست کراوە.','Open downloadable files in the browser, instead of saving them to the device.'=>'کردنەوەی ئەو پەڕگانەی توانای داگرتنیان هەیە لە وێبگەڕەکە، لەجیاتیی پاشەکەوت کردنیان بۆ ئامێرەکە.','Open in browser'=>'کردنەوە لە وێبگەڕ','Summarize this product in 1-2 short sentences. We’ll show it at the top of the page.'=>'پوختەکردنی ئەم بەرهەمە لە 1-2 ڕستەی کورتدا. لە سەرەوەی پەڕەکە پیشانی دەدەین.','Customers can still save the file to their device, but by default file will be opened instead of being downloaded (does not work with redirects).'=>'کڕیاران هەر دەتوانن پەڕگەکە دابگرن بۆ ئامێرەکانیان، بەڵام بەشێوەیەکی بنەڕەت پەڕگە دەکرێتەوە لەجیاتیی داگرتن [کار ناکات لەگەڵ ئاڕاستەکردنەوەکان (redirects)].','Are you sure you want to disconnect your store from WooCommerce.com?'=>'دڵنیاییت دەتەوێت پەیوەستیی فرۆشگاکەت بپچڕێنیت لەگەڵ (WooCommerce.com)؟','Your store is not connected to WooCommerce.com. Run `wp wc com connect` command.'=>'فرۆشگاکەت پەیوەست نییە بە (WooCommerce.com)ەوە. فرمانی `wp wc com connect` جێبەجێ بکە.','Describe this product. What makes it unique? What are its most important features?'=>'باسی ئەم بەرهەمە بکە. چی وای کردووە ناوازە بێت؟ گرنگترین تایبەتمەندییەکانی چییە؟','Product types define available product details and attributes, such as downloadable files and variations. They’re also used for analytics and inventory management.'=>'جۆرەکانی بەرهەم پێناسەی وردەکاری و تایبەتمەندیی بەرهەمە بەردەستەکان دەکەن، وەکو ئەو پەڕگانەی توانای داگرتنیان هەیە و گۆڕانکارییەکان. هەروەها بەکاردەهێنرێن بۆ شیکارییەکان و بەڕێوەبردنی کۆگا.','<b>Variable –</b> a product with variations, each of which may have a different SKU, price, stock option, etc. For example, a t-shirt available in different colors and/or sizes.'=>'<b>گۆڕاو –</b> بەرهەمێک لەگەڵ گۆڕانکارییەکان، هەر دانەیەکیان دەکرێت (SKU)یەکی جیاواز، نرخ، هەڵبژاردەی کۆگای جیاوازی هەبێت. بۆ نموونە، بلوسێک دەکرێت ڕەنگ و قەبارەی جیاوازی هەبێت.','<b>External or Affiliate –</b> one that you list and describe on your website but is sold elsewhere.'=>'<b>دەرەکیی یان پشتبەستوو –</b> شتێک کە لەناو ماڵپەڕەکەت باسی دەکەیت بەڵام لە شوێنێکی تر دەفرۆشرێت.','<b>Grouped –</b> a collection of related products that can be purchased individually and only consist of simple products. For example, a set of six drinking glasses.'=>'<b>گرووپکراو –</b> کۆمەڵێک لە بەرهەمی هاوشێوە کە دەکرێت بە تەنیا بکڕدرێن و بەرهەمی سادەن. بۆ نموونە، دەستەیەکی شەش پەرداخی.','<b>Simple –</b> covers the vast majority of any products you may sell. Simple products are shipped and have no options. For example, a book.'=>'<b>سادە –</b> ئەمە زۆرینەی ئەو بەرهەمانەیە کە دەیفرۆشیت. بەرهەمە سادەکان هیچ هەڵبژاردەیەکیان نییە. بۆ نممونە، کتێبێک.','Sofia District'=>'Sofia District','block descriptionDisplay products from your store in a grid layout.'=>'پیشاندانی بەرهەمەکانی فرۆشگاکەت لە گەڵاڵەبەندییەکی خانەخانەیی.','block titleAll Products'=>'هەموو بەرهەمەکان','block descriptionDisplay a grid of products from your selected categories.'=>'پیشاندانی تۆڕێکی خانەخانەیی بەرهەمەکان لە هاوپۆلە دیاریکراوەکانت.','block titleProducts by Category'=>'بەرهەمەکان بەپێی هاوپۆل','block descriptionShow all product categories as a list or dropdown.'=>'پیشاندانی سەرجەم هاوپۆلی بەرهەمەکان وەکو لیستە یان هاتنەخوارەوە.','block titleProduct Categories List'=>'لیستەی هاوپۆلەکانی بەرهەم','block descriptionDisplay a grid of your all-time best selling products.'=>'پیشاندانی تۆڕێکی خانەخانەیی لە پڕفرۆشترین بەرهەمەکانت.','block titleBest Selling Products'=>'پڕفرۆشترین بەرهەمەکان','You cannot edit this item because it is in the Trash. Please restore it and try again.'=>'ناتوانیت دەستکاریی ئەم بڕگەیە بکەیت چونکە لە تەنەکەی خۆڵەکەدایە. تکایە بیهێنەرەوە پاشان دووبارە هەوڵ بدەرەوە.','This info will be displayed on the product page, category pages, social media, and search results.'=>'ئەم زانیارییە پیشان دەدرێت لە پەڕەی بەرهەمەکە، پەڕەکانی هاوپۆل، تۆڕە کۆمەڵایەتییەکان و ئەنجامەکانی گەڕان.','Buy one of this item'=>'دانەیەک لەم مادەیە بکڕ