ەدوای تایبەتمەندییەکانی بەرهەم','Select a product to regenerate the data for, or leave empty for a full table regeneration:'=>'بەرهەمێک دیاریبکە بۆ دووبارە دروستکردنەوەی دراوە بۆی، یان بە بەتاڵیی بەجێیبهێڵە بۆ دروستکردنەوەی تەواوی خشتە:','Additional data to pass to the extension'=>'دراوەی زیاتر کە تێدەپەڕێت بۆ زیادکراوەکە','Extension\'s name - this will be used to ensure the data in the request is routed appropriately.'=>'ناوی زیادکراو - ئەمە بەکاردەهێنرێت بۆ دڵنیابوون لەوەی کە دراوەکانی ناو داواکارییەکە بە شێوەیەکی گونجاو ڕێڕەو دەکرێن.','N. Revenue (formatted)'=>'داهاتی پوخت (فۆرماتکراو)','Net total revenue (formatted).'=>'داهاتی گشتیی پوخت (فۆرماتکراو).','When true, refunded items are restocked.'=>'کاتێک (true) بوو، ئەو کاڵایانەی پارەکانیان گەڕاوەتەوە ژمارەکانیان دەگەڕێتەوە کۆگا.','Page titleRefund and Returns Policy'=>'سیاسەتی پارەدانەوە و گەڕاندنەوە','We have created a sample draft Refund and Returns Policy page for you. Please have a look and update it to fit your store.'=>'پەڕەیەکی نموونەی سیاسەتی پارەدانەوە و گەڕاندنەوەمان وەکو ڕەشنووس بۆ دروست کردوویت. تکایە تەماشای بکە و بیگونجێنە لەگەڵ فرۆشگاکەت.','Update the table directly upon product changes, instead of scheduling a deferred update.'=>'ڕاستەوخۆ خشتەکە نوێ بکەرەوە لەگەڵ هەر دەستکارییەکی بەرهەم، لەجیاتیی کات دانان بۆ بەڕۆژکردنەوەی دواخراو.','Setup a Refund and Returns Policy page to boost your store\'s credibility.'=>'پەڕەی سیاسەتی پارەدانەوە و گەڕاندنەوە دروستبکە بۆ زیادکردنی متمانەی فرۆشگاکەت.','Limit result set to products that are low or out of stock. (Deprecated)'=>'ئەنجامی دانراو سنووردار بکە بۆ ئەو بەرهەمانەی کە کەمن یان لە کۆگادا نیین. (بەسەرچوو)','%1$s could not be served using the Force Download method. A redirect will be used instead.'=>'%1$s ڕاژە ناکرێت بە بەکارهێنانی داگرتن بەزۆر. ئاڕاستەکردنەوە بەکاردەبرێت.','%1$s could not be served using the X-Accel-Redirect/X-Sendfile method. A Force Download will be used instead.'=>'%1$s ڕاژە ناکرێت بەبەکارهێنانی شێوەی (X-Accel-Redirect/X-Sendfile). داگرتن بەزۆر بەکاردەبرێت.','If the "Force Downloads" or "X-Accel-Redirect/X-Sendfile" download method is selected but does not work, the system will use the "Redirect" method as a last resort. <a href="%1$s">See this guide</a> for more details.'=>'ئەگەر شێوازەکانی "داگرتن بەزۆر" یان "X-Accel-Redirect/X-Sendfile" دیاریکرابوون بەڵام کاریان نەکرد، سیستەمەکە "ئاڕاستەکردنەوە" بەکاردەبات. <a href="%1$s">تەماشای ئەم ڕێبەرییە بکە</a> بۆ وردەکاریی زیاتر.','Allow using redirect mode (insecure) as a last resort'=>'ڕێگەدان بەبەکارهێنانی دۆخی ئاڕاستەکردنەوە (پارێزراو نییە)','Task Options'=>'هەڵبژاردەکانی ئەرک','Set your store location and where you\'ll ship to.'=>'ناونیشانی فرۆشگاکەت دابنێ و بۆ کوێش گەیاندن دەکەیت.','Choose payment providers and enable payment methods at checkout.'=>'دابینکەرانی پارەدان هەڵبژێرە و شێوازەکانی پارەدان لە کاتی پارەدان چالاک بکە.','You\'re only one step away from getting paid. Verify your business details to start managing transactions with WooPayments.'=>'تەنیا چەند هەنگاوێکی کەم ماوە تا دەست بکەیت بە فرۆشتن و پارەکانت بەئاسانیی وەربگریت. وردەکارییەکانی کارەکەت بسەلمێنە و دەستبکە بەڕێوەبردنی مامەڵەکانت لەگەڵ (WooPayments).','Grow your store'=>'فرۆشگاکەت گەورە بکە','Protect your WooCommerce Store with Jetpack Backup.'=>'فرۆشگاکەت بپارێزە لە ڕێگەی پاڵپشتیی (Jetpack).','Start by adding the first product to your store. You can add your products manually, via CSV, or import them from another service.'=>'دەستپێبکە بە زیادکردنی یەکەم بەرهەم بۆ فرۆشگاکەت. دەتوانیت دانە دانە بەرهەمەکان زیادبکەیت، لە ڕێگەی (CSV) یان هاوردنیان لە ڕاژەیەکی ترەوە.','Your store address is required to set the origin country for shipping, currencies, and payment options.'=>'ناونیشانی کارەکەت پێویستە بۆ دانانی وڵاتی سەرەکیی بۆ گەیاندن، دراو، هەروەها هەڵبژاردەکانی پارەدان.','Set your store location and configure tax rate settings.'=>'شوێنی فرۆشگاکەت دابنێ و ڕێکخستنەکانی ڕێژەی باج ڕێکبخە.','The rate at which tax is applied.'=>'ئەو ڕێژەیەی کە باج جێبەجێ دەکرێت بۆی.','Notes are unavailable because the "admin-note" data store cannot be loaded.'=>'تێبینییەکان بەردەست نیین لەبەر ئەوەی ناتوانرێت کۆگای دراوەی "admin-note" باربکرێت.','Get backups'=>'پاڵپشتییەکان بەدەستبهێنە','Store downtime means lost sales. One-click restores get you back online quickly if something goes wrong.'=>'لەکارکەوتنی فرۆشگا واتە لەدەستدانی فرۆشتن. گەڕاندنەوەی یەک کرتە بەخێرایی دەتباتەوە سەرهێڵ ئەگەر هەڵەیەک ڕوویدا.','Mollie'=>'Mollie','The Payfast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa’s most popular payment gateways. No setup fees or monthly subscription costs. Selecting this extension will configure your store to use South African rands as the selected currency.'=>'زیادکراوی (Payfast) بۆ (WooCommerce) ڕێگەت دەدات پارە بە کرێدت کارد و (EFT) وەربگریت لە ڕێگەی یەکێک لە دەرەڕێ بەناوبانگەکانی باشووری ئەفریقا. هیچ کرێیەکی پێشەکیی یان پارەدانی مانگانەی نییە. هەڵبژاردنی ئەم زیادکراوە وادەکات فرۆشگاکەت دراوی باشووری ئەفریقا بەکاربهێنێت.','Variations Sold'=>'گۆڕانکاریی فرۆشراو','Products sold'=>'بەرهەمی فرۆشراو','Download %d ID'=>'داگرتنی %d ناسنامە','Data store:'=>'کۆگای دراوە:','Source of note.'=>'سەرچاوەی تێبینی.','Number of variation items sold.'=>'ژمارەی گۆڕانکاریی فرۆشراو.','Number of product items sold.'=>'ژمارەی کاڵای فرۆشراو.','This section shows details of Action Scheduler.'=>'ئەم بەشە وردەکارییەکانی کات دانەری کردار پیشان دەدات.','Products by Rating list'=>'بەرهەمەکان بەپێی لیستەی هەڵسەنگاندنەکان','Change status to cancelled'=>'گۆڕینی دۆخ بۆ ڕەتکراوە','Recently Viewed Products list'=>'لیستەی دواین بەرهەمە بینراوەکان','Things to do next'=>'شتەکان کە دواتر ئەنجامی بدەیت','Manage transactions without leaving your WordPress Dashboard. Only with WooPayments.'=>'گواستنەوەکانت بەڕێوەببە بەبێ جێهێشتنی داشبۆردی وۆردپرێسەکەت. تەنیا لەگەڵ (WooPayments).','Product Link'=>'بەستەری بەرهەم','Product Tag Link'=>'بەستەری تاگی بەرهەم','How easy was it to add a product tag?'=>'تا چەند ئاسان بوو زیادکردنی تاگی بەرهەم؟','A link to a product.'=>'بەستەرێک بۆ بەرهەم.','A link to a product tag.'=>'بەستەرێک بۆ تاگی بەرهەم.','A link to a product category.'=>'بەستەرێک بۆ هاوپۆلی بەرهەم.','Product Category Link'=>'بەستەری هاوپۆلی بەرهەم','Create and send purchase follow-up emails, newsletters, and promotional campaigns straight from your dashboard.'=>'پۆستی ئەلیکترۆنییەکانی تایبەت بە داواکارییەکان و بانگەشە و کەمپینەکانی بازاڕدۆزی دروستبکە و بیاننێرە ڕاستەوخۆ لەناو داشبۆردەکەتەوە.','Invalid path provided.'=>'ڕێچکەی نادروست دابینکراوە.','To ensure your store&rsquo;s notifications arrive in your and your customers&rsquo; inboxes, we recommend connecting your email address to your domain and setting up a dedicated SMTP server. If something doesn&rsquo;t seem to be sending correctly, install the <a href="%1$s">WP Mail Logging Plugin</a> or check the <a href="%2$s">Email FAQ page</a>.'=>'بۆ دڵنیابوونەوە لەوەی ئاگادارکەرەوەکانی فرۆشگاکەت بەسەرکەوتوویی دەگاتە ناو نامەدانی خۆت و کڕیارەکانت، ئێمە پێشنیاری دەکەین ناونیشانی پۆستی ئەلیکترۆنییەکەت پەیوەست بکەیت بە ناوی پاوانەکەتەوە، هەروەها ڕاژەکارێکی سەربەخۆی (SMTP) دابمەزرێنیت. ئەگەر هەڵەیەک ڕوویدا، پێوەکراوی <a href="%1$s">WP Mail Logging</a> دابمەزرێنە یان تەماشای <a href="%2$s">پهدی پۆستی ئەلیکترۆنی</a> بکە.','Zulia'=>'Zulia','Táchira'=>'Táchira','Sucre'=>'Sucre','Portuguesa'=>'Portuguesa','Nueva Esparta'=>'Nueva Esparta','Monagas'=>'Monagas','Miranda'=>'Miranda','Mérida'=>'Mérida','Lara'=>'Lara','Guárico'=>'Guárico','Falcón'=>'Falcón','Cojedes'=>'Cojedes','Carabobo'=>'Carabobo','Bolívar'=>'Bolívar','Barinas'=>'Barinas','Aragua'=>'Aragua','Apure'=>'Apure','Anzoátegui'=>'Anzoátegui','Capital'=>'Capital','Delta Amacuro'=>'Delta Amacuro','Federal Dependencies'=>'Federal Dependencies','Yaracuy'=>'Yaracuy','Trujillo'=>'Trujillo','Filling in progress (%d)'=>'جێبەجێکردن بەردەوامە (%d)','Product attributes lookup table data is regenerating'=>'دراوەی خشتەی گەڕان بەدوای تایبەتمەندییەکانی بەرهەم دووبارە دروست دەکرێتەوە','This tool will regenerate the product attributes lookup table data from existing product(s) data. This process may take a while.'=>'ئەم ئامڕازە دراوەی خشتەی گەڕان بەدوای تایبەتمەندییەکانی بەرهەم دروست دەکاتەوە لە دراوەی بەرهەمە هەبووەکانەوە. ئەم پرۆسەیە پێویستی بە کاتە.','Regenerate the product attributes lookup table'=>'دروستکردنەوەی خشتەی گەڕان بەدوای تایبەتمەندییەکانی بەرهەم','MailPoet'=>'MailPoet','Paystack'=>'Paystack','%s connected successfully'=>'%s بەسەرکەوتوویی پەیوەستکرا','How easy was it to use search?'=>'تا چەند ئاسان بوو بەکارهێنانی گەڕان؟','How easy was it to add a product attribute?'=>'تا چەند ئاسان بوو زیادکردنی تایبەتمەندیی بەرهەم؟','How easy was it to add product category?'=>'تا چەند ئاسان بوو زیادکردنی هاوپۆلی بەرهەم؟','Paystack helps African merchants accept one-time and recurring payments online with a modern, safe, and secure payment gateway.'=>'(Paystack) یارمەتیی فرۆشیارە ئەفریقاییەکان دەدات پارەدانی یەکجار و بەردەوام قبووڵ بکەن لەگەڵ دەرەڕێیەکی پارەدانی پارێزراو و نوێ و خێرا.','Hi there,'=>'سڵاو،','Nice one; you\'ve created a WooCommerce store! Now it\'s time to add your first product and get ready to start selling.%s'=>'زۆر تەواوە: تۆ فرۆشگایەکی (WooCommerce)ت دروستکرد! ئێستا کاتییەتی یەکەم بەرهەمت زیادبکەیت و ئامادەبیت بۆ فرۆشتن. %s','%s (optional)'=>'%s (ئارەزوومەندانە)','Enable PayU’s exclusive plugin for WooCommerce to start accepting payments in 100+ payment methods available in India including credit cards, debit cards, UPI, & more!'=>'پێوەکراوی تایبەتی (PayU) بۆ (WooCommerce) چالاکبکە بۆ وەرگرتنی پارە بە زیاتر لە 100 شێوازی پارەدان، تەنیا بەردەستە لە هیندستان.','Get ready to start selling'=>'ئامادەبە بۆ دەستکردن بە فرۆشتن','PayU for WooCommerce'=>'PayU بۆ WooCommerce','%1$s and %2$s'=>'%1$s و %2$s','"%s" is already registered.'=>'"%s" پێشتر تۆمارکراوە.','Block name is required.'=>'ناوی بڵۆک پێویستە.','Integration "%s" is not registered.'=>'یەکخستنی "%s" تۆمارنەکراوە.','Integration registry requires an identifier.'=>'تۆمارکردنی یەکخستن پێویستی بە ناسێنەر هەیە.','There was an error with an item in your cart.'=>'هەڵەیەک هەبوو لە کاڵایەکی ناو سەبەتەکەت.','There are not enough %s in stock. Please reduce the quantities in your cart.'=>'بڕی پێویستی %s لە کۆگادا نییە. تکایە بڕەکانی ناو سەبەتەکەت کەمبکەرەوە.','There is not enough %s in stock. Please reduce the quantity in your cart.'=>'بڕی پێویستی %s لە کۆگادا نییە. تکایە بڕەکەی ناو سەبەتەکەت کەمبکەرەوە.','There are too many %s in the cart. Only 1 of each can be purchased. Please reduce the quantities in your cart.'=>'ژمارەیەکی زۆری %s لە سەبەتەکەدا هەیە. تەنیا 1 دانە ڕێگەپێدراوە لە هەر یەکێکیان بۆ کڕین. تکایە بڕەکانی ناو سەبەتەکەت کەمبکەرەوە.','There are too many %s in the cart. Only 1 can be purchased. Please reduce the quantity in your cart.'=>'ژمارەیەکی زۆری %s لە سەبەتەکەدا هەیە. تەنیا 1 دانە ڕێگەپێدراوە بۆ کڕین. تکایە بڕی ناو سەبەتەکەت کەمبکەرەوە.','%s cannot be purchased. Please remove them from your cart.'=>'%s ناتوانرێت بکڕدرێن. تکایە لایانبەرە لەناو سەبەتەکەت.','%s cannot be purchased. Please remove it from your cart.'=>'%s ناتوانرێت بکڕدرێت. تکایە لایبەرە لەناو سەبەتەکەت.','%s are out of stock and cannot be purchased. Please remove them from your cart.'=>'%s بەردەست نیین لە کۆگا و ناتوانرێت بکڕدرێن. تکایە لایانبەرە لەناو سەبەتەکەت.','%s is out of stock and cannot be purchased. Please remove it from your cart.'=>'%s بەردەست نییە لە کۆگا و ناتوانرێت بکڕدرێت. تکایە لایبەرە لەناو سەبەتەکەت.','of'=>'لە','Step'=>'هەنگاو','Tax class slug is invalid'=>'سڵەگی پۆلی باج نادروستە','Start selling'=>'دەستبکە بە فرۆشتن','WooCommerce Setup'=>'دامەزراندنی (WooCommerce)','List of city names. Introduced in WooCommerce 5.3.'=>'لیستەی ناوی ئەو شارانەی لە (WooCommerce 5.3)وە ناسێنراون.','City name, it doesn\'t support multiple values. Deprecated as of WooCommerce 5.3, \'cities\' should be used instead.'=>'ناوی شار، پشتگیریی چەند بەهایەک ناکات. بەسەرچووە لە (WooCommerce 5.3)ەوە، لەجیاتیی ئەوە دەبێت \'cities\' بەکارببرێت.','Postcode/ZIP, it doesn\'t support multiple values. Deprecated as of WooCommerce 5.3, \'postcodes\' should be used instead.'=>'Postcode/ZIP، پشتگیریی چەند بەهایەک ناکات. بەسەرچووە لە (WooCommerce 5.3)ەوە، لەجیاتیی ئەوە دەبێت \'postcodes\' بەکارببرێت.','List of postcodes / ZIPs. Introduced in WooCommerce 5.3.'=>'لیستەی کۆدی پۆستە\\ZIP کە ناسێنراون لە (WooCommerce 5.3).','Amount that will be refunded for this tax.'=>'ئەو بڕە پارەیەی کە بۆ ئەم باجە دەگەڕێتەوە.','Amount that will be refunded for this line item (excluding taxes).'=>'ئەو بڕە پارەیەی کە بۆ ئەم هێڵی کاڵایە دەگەڕێتەوە (بەبێ باج).','Limit result set to resources assigned to a specific parent. Applies to hierarchical taxonomies only.'=>'سنووردارکردنی ئەنجام بۆ ئەو سەرچاوانەی سپێردراون بە باوانێکی دیاریکراو. تەنیا دەچەسپێت بەسەر پۆلێنکردنە پلەمەندییەکان.','Offset the result set by a specific number of items. Applies to hierarchical taxonomies only.'=>'هاوسەنگکردنی ئەنجامەکە بۆ ژمارەیەکی دیاریکراوی کاڵا. تەنیا دەچەسپێت بەسەر پۆلێنکردنە پلەمەندییەکان.','Low Stock amount for the product.'=>'بڕی کەمیی کۆگا بۆ بەرهەمەکە.','Low Stock amount for the variation.'=>'بڕی کەمیی کۆگا بۆ گۆڕانکارییەکە.','Coupon item ID is readonly.'=>'ناسنامەی کاڵای کۆبۆن تەنیا خوێندنەوەیە.','Search for a page&hellip;'=>'گەڕان بۆ پەڕەیەک&hellip;','Additional tax class "%1$s" couldn\'t be saved. %2$s.'=>'پۆلی باجی زیاتر "%1$s" نەتوانرا پاشەکەوت بکرێت. %2$s.','You\'re almost there! Once you complete store setup you can start receiving orders.'=>'ئەوەندەی نەماوە! کاتێک تەواوبوویت لە دامەزراندنی فرۆشگاکەت، ئیتر دەتوانیت داواکارییەکان وەربگریت.','When variation stock reaches this amount you will be notified by email. The default value for all variations can be set in the product Inventory tab. The shop default value can be set in Settings > Products > Inventory.'=>'کاتێک بڕی گۆڕانکاریی لە کۆگا گەیشتە ئەم بڕە لە ڕێگەی پۆستی ئەلیکترۆنییەوە ئاگادار دەکرێیتەوە. بەهای بنەڕەتیی بۆ سەرجەم گۆڕانکارییەکان لە سەرخشتەی کۆگای بەرهەمەکە دادەنرێت. بەهای بنەڕەتیی فرۆشگاکە لە ڕێکخستنەکان > بەرهەمەکان > کۆگا دادەنرێت.','%1$s (ID: %2$s)'=>'%1$s (ناسنامە: %2$s)','When product stock reaches this amount you will be notified by email. It is possible to define different values for each variation individually. The shop default value can be set in Settings > Products > Inventory.'=>'کاتێک بڕی بەرهەم لە کۆگا گەیشتە ئەم بڕە لە ڕێگەی پۆستی ئەلیکترۆنییەوە ئاگادار دەکرێیتەوە. دەکرێت بەهای جیاواز دابنێیت بۆ هەر گۆڕانکارییەک بەجیا. بەهای بنەڕەتیی فرۆشگاکە لە ڕێکخستنەکان > بەرهەمەکان > کۆگا دادەنرێت.','Parent product\'s threshold (%d)'=>'خاڵی دەستپێکی بەرهەمی باوان (%d)','Store-wide threshold (%d)'=>'خاڵی دەستپێکی فرۆشگا (%d)','The selected product isn\'t a variation of %2$s, please choose product options by visiting <a href="%1$s" title="%2$s">%2$s</a>.'=>'بەرهەمە دیاریکراوەکە گۆڕانکاریی %2$s نییە، تکایە هەڵبژاردەکانی بەرهەم دیاریبکە بە سەردانکردنی <a href="%1$s" title="%2$s">%2$s</a>.','PayPal Payments'=>'PayPal Payments','Effortless payments by Mollie: Offer global and local payment methods, get onboarded in minutes, and supported in your language.'=>'پارەدانی خێرا لە ڕێگەی (Mollie): شێوازی پارەدانی جیهانی و ناوخۆیی پێشکەش بکە، لە چەند خولەکێکدا ئامادە دەبێت و بە زمانی خۆت پشتگیریی دەکرێت.','billing address'=>'ناونیشانی پارەدان','Add manually'=>'زیادکردنی دەستیی','%s is required'=>'%s داواکراوە','shipping address'=>'ناونیشانی گەیاندن','The provided phone number is not valid'=>'ژمارەی تەلەفوون نادروستە','The provided email address is not valid'=>'ناونیشانی پۆستی ئەلیکترۆنی نادروستە','There was a problem with the provided %s:'=>'کێشەیەک هەبوو لە %s:','List of cart fees.'=>'لیستەی کرێی سەبەتە.','Value of the metadata.'=>'بەهای مێتاداتاکە.','Name of the metadata.'=>'ناوی مێتاداتاکە.','Optionally, how the metadata value should be displayed to the user.'=>'ئارەزوومەندانە: چۆن بەهای مێتاداتاکە پیشان بدرێت بۆ بەکارهێنەرەکە؟','Total amount for this fee.'=>'کۆی گشتیی بۆ ئەم کرێیە.','Total tax amount for this fee.'=>'کۆی گشتیی باج بۆ ئەم کرێیە.','Metadata related to the item'=>'مێتاداتای پەیوەست بە کاڵاکەوە','List of required payment gat