ەدان','Get real-time order alerts anywhere'=>'ئاگادارکەرەوەی داواکارییەکان لەکاتی دروستی خۆیاندا بەدەستبهێنە لە گشت شوێنێک','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'ئاگادارکەرەوەکان بەدەستبهێنە دەربارەی چالاکییەکانی فرۆشگاکەت، داواکارییە نوێیەکان و پێداچوونەوەکانی بەرهەم لەناو تەلەفوونەکەت لەگەڵ بەرنامەی بەکاربەریی (Woo).','First order received'=>'یەکەم داواکاریی گەیشت','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'ئەگەر فرۆشگاکەت لە ئەوروپایە، پێشنیاری دەکەین زیادکراوی ژمارەی (VAT)ی ئەوروپا بەکاربهێنیت هاوتای باجە خۆکارەکان. ئەمە خانەیەک لە پەڕەی پارەدان زیاد دەکات کە ڕێگەت پێدەدات بۆ کردنەوە و پەسەندکردنی ژمارەی (VAT)ی کڕیارانت، ئەگەر هەیانبێت.','Database verified successfully.'=>'بنکەدراوە بەسەرکەوتوویی سەلمێندرا.','Invalid category ID.'=>'ناسنامەی نادروستی هاوپۆل.','You need WooCommerce 4.2 or newer to run this tool.'=>'پێویستت بە (WooCommerce)ی 4.2 یان نوێتر هەیە بۆ ئەوەی کار بەم ئامڕازە بکەیت.','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'ئەم ڤیدیۆ فێرکارییە یارمەتییت دەدات لە پرۆسەی زیادکردنی یەکەم بەرهەمت لە (WooCommerce).','Do you need help with adding your first product?'=>'یارمەتییت دەوێت لە زیادکردنی یەکەم بەرهەمت؟','Start your online clothing store'=>'دەستبکە بە دروستکردنی فرۆشگای جلوبەرگەکەت','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'دەستکردن بە دروستکردنی ماڵپەڕێکی جلوبەرگ هەنگاوێکی مەزنە، بەڵام لەهەمان کاتیشدا دەکرێت کارێکی ئاڵۆز بێت. لەم بابەتەدا، بە سەرجەم هەنگاوەکان ئاشناتان دەکەین، چۆن لیستەیەکی سەرکەوتووی بەرهەم دروست بک