o.'=>'ناسێنەری بێهاوتا بۆ بەرهەمەکە کە پێداچوونەوەکەی بۆ نووسراوە.','The object cannot be deleted.'=>'ناتوانرێت تەنەکە بسڕدرێتەوە.','The object has already been trashed.'=>'تەنەکە خۆی فڕێدراوە.','The object does not support trashing. Set \'%s\' to delete.'=>'تەنەکە پشتگیریی فڕێدان ناکات. \'%s\' دابنێ بۆ سڕینەوە.','Updating review failed.'=>'بەڕۆژکردنەوەی پێداچوونەوە شکستی هێنا.','Invalid review content.'=>'ناوەڕۆکی نادروستی پێداچوونەوە.','Updating review status failed.'=>'بەڕۆژکردنەوەی دۆخی پێداچوونەوە شکستی هێنا.','Product review field exceeds maximum length allowed.'=>'خانەی پێداچوونەوەی بەرهەم لە زۆرترین درێژیی ڕێگەپێدراو تێپەڕی.','View affected templates'=>'بینینی قاڵبە کارتێکراوەکان','Full name of continent.'=>'ناوی تەواوی کیشوەر.','List of countries on this continent.'=>'لیستەی وڵاتەکان لەسەر ئەم کیشوەرە.','Products totals.'=>'کۆی گشتیی بەرهەمەکان.','Your {site_title} order is now complete'=>'داواکارییەکەت لە {site_title} جێبەجێکرا','Unique identifier for the product.'=>'ناسێنەری بێهاوتا بۆ بەرهەمەکە.','Details for order #{order_number} on {site_title}'=>'وردەکاریی بۆ داواکاریی #{order_number} لە {site_title}','We\'ve created two Shipping Zones - for %s and for the rest of the world. Below you can set Flat Rate shipping costs for these Zones or offer Free Shipping.'=>'ئێمە دوو هەرێمی بارکردنمان دروست کردووە - بۆ %s و بۆ هەموو جیهان. لە خوارەوە دەتوانیت نرخە تەختەکانی بارکردن بۆ ئەم ناوچانە دابنێیت یان ئۆفەری بارکردن بەخۆڕایی بکەیت.','If you\'d like to offer <span class="help_tip" data-tip="%1$s">live rates</span> from a specific carrier (e.g. UPS) you can find a variety of extensions available for WooCommerce <a href="%2$s" target="_blank">here</a>.'=>'ئەگەر دەتەوێت <span class="help_tip" data-tip="%1$s">ڕێژەی ڕاسته‌وخۆ</span> لە یەکێک لە هەڵگرێکی دیاریکراو (بۆ نموونە UPS) دەتوانیت جۆرەها درێژکراوەبەردەستەکان بۆ ووکۆمێرس<a href="%2$s" target="_blank">لێرە</a>','A live rate is the exact cost to ship an order, quoted directly from the shipping carrier.'=>'ڕێژەی 