e files be revoked and download logs cleared?'=>'کاتی %s، دەستگەیشتن بەو پەڕگانەی توانای داگرتنیان هەیە هەڵوەشێندرێتەوە و ڕووداوتۆمارگەرییەکانی داگرتن بسڕدرێنەوە؟','Sud Sardegna'=>'Sud Sardegna','San Pedro'=>'San Pedro','Cordillera'=>'Cordillera','Central'=>'Central','Amambay'=>'Amambay','Presidente Hayes'=>'Presidente Hayes','Alto Paraguay'=>'Alto Paraguay','Yards'=>'یارد','Meters'=>'مەتر','Ounces'=>'ئۆنس','Pounds'=>'پاوند','Grams'=>'گرام','Kilograms'=>'کیلۆگرام','Item moved down'=>'کاڵا گواسترایەوە بۆ خوارەوە','Item moved up'=>'کاڵا گواسترایەوە بۆ سەرەوە','You may need to manually restore the item\'s stock.'=>'لەوانەیە پێویست بێت بەشێوەیەکی دەستیی کۆگای کاڵاکە دەستکاریی بکەیت و بیگەڕێنیتەوە.','Are you sure you want to remove the selected items?'=>'ئایا دڵنیایت لە سڕینەوەی کاڵا دیاریکراوەکان؟','Inches'=>'ئینچ','Millimeters'=>'میلیمەتر','Centimeters'=>'سانتیمەتر','Apartment, suite, unit, etc.'=>'زانیاریی زیاتری ناوچەکەت، شوێنی نزیک لێت، هتد.','%d API key permanently revoked.'=>'%d کلیلی (API) بەشێوەیەکی هەمیشەیی هەڵوەشێنرایەوە.' . "\0" . '%d کلیلی (API) بەشێوەیەکی هەمیشەیی هەڵوەشێنرانەوە.','shipping packagesShipping %d'=>'گەیاندن %d','Shipping Address'=>'ناونیشانی ناردنی کاڵا','Shipping Address 1'=>'ناونیشانی گواستنەوە ١','Billing Address'=>'ناونیشانی پارەدان','Billing Address 1'=>'ناونیشانی پارەدان 1','If you have a coupon code, please apply it below.'=>'ئەگەر کۆبۆنی داشکاندنت پێیە، تکایە لە خوارەوە بینووسە.','This will be how your name will be displayed in the account section and in reviews'=>'ئەمە ئەو ناوەیە کە لەناو هەژمارەکەت و پێداچوونەوەکانت پیشان دەدرێت.','terms and conditions'=>'مەرج و یاساکان','United States (US) dollar'=>'دۆلاری ویلایەتە یەکگرتووەکان','privacy policy'=>'سیاسەتی تایبەتێتی','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'پارەدانەکان قبوڵ دەکەین لە ڕێگەی پەی پاڵەوە کاتێک پارەدانەکان جێبەجێ دەکرێت، هەندێک لە داتاکەت دەگوازرێتە سەر پەی پاڵ، لەوانە زانیاری پێویست بۆ پرۆسەکردن یان پشتگیری پارەدان، وەک کۆی گشتی کڕین و زانیاری پسوڵە بکات.','Required'=>'پێویست','%1$s (#%2$s)'=>'%1$s (#%2$s)','%1$s &ndash; %2$s'=>'%1$s &ndash; %2$s','Comma-separated list of search stopwords in your languageabout,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www'=>'بۆ, لە, کوێ, کەی, من, تۆ, ماڵپەڕ, کە, ','Other locations'=>'شوێنەکانی تر','Any &quot;%1$s&quot; method'=>'هەر شێوازێکی &quot;%1$s&quot;','Take payments in person via checks. This offline gateway can also be useful to test purchases.'=>'ڕووبەڕوو پارە وەربگرە لە ڕێگەی چەکەوە. ئەم دەرەڕێ دەرهێڵە دەتوانرێت بەکاریش ببرێت بۆ تاقیکردنەوەی کڕینەکان.','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'ڕووبەڕوو پارە وەربگرە لە ڕێگەی (BACS). ناسراویشە بە (گواستنەوەی ڕاستەوخۆ bank/wire).','No page set'=>'هیچ پەڕەیەک دانەنراوە','Highlight required fields with an asterisk'=>'خانە پێویستەکان دیاریبکە لەگەڵ ئەستێرۆکەیەک','I have read and agree to the website %s'=>'%sم خوێندەوە و ڕەزامەندم','%s field'=>'خانەی %s','These options let you change the appearance of the WooCommerce checkout.'=>'ئەم هەڵبژاردانە ڕێگەت دەدەن چۆنییەتی دەرکەوتی پارەدانی (WooCommerce) بگۆڕیت.','Account details:'=>'وردەکارییەکانی هەژمار:','PayPal Standard redirects customers to PayPal to enter their payment information.'=>'(PayPal Standard) کڕیاران ئاڕاستەی (PayPal) دەکات بۆ ئەوەی زانیاریی پارەدانیان بنووسن.','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'تکایە تەماشای <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">سیاسەتی تایبەتێتیی (PayPal)</a> بکە بۆ وردەکاریی زیاتر.','%s page'=>'پەڕەی %s','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'لەم بەشە لاوەکیەدا پێویستە لیستی ئەوە بکەیت کە چارەسەرکەری پارەدانی لایەنی سێیەم کە بەکاری دەهێنیت بۆ وەرگرتنی پارە لە فرۆشگاکەت لەبەرئەوەی لەوانەیە ئەمانە داتای کڕیار چارەسەر بکەن. ئێمە پەی پاڵمان وەک نموونە یەک لە خۆی کردووە، بەڵام دەبێت ئەمە لاببەیت ئەگەر پەی پال بەکار ناهێنیت.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'زانیاری هاوبەش دەکەین لەگەڵ لایەنی سێیەم کە یارمەتیمان دەدات بۆ دابینکردنی فەرمانەکانمان و هەڵگرتنی خزمەتگوزاری بۆتان؛ بۆ نموونە --','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'لەم بەشەدا پێویستە ئەو کەسەی کە داتات هاوبەش کردووە لەگەڵی، و بۆ چ مەبەستێک لیست بکەیت. ئەمە لەوانەیە لەخۆبگرێت، بەڵام لەوانەیە سنووردار نەبێت بە، شیکردنەوەکان، بەبازاڕکردن، دەروازەکانی پارەدان، دابینکەرانی کەشتیکردن، و سێهەم لایەنە کە بنچینکراون.','We will also store comments or reviews, if you choose to leave them.'=>'هەروەها سەرنج یان پێداچوونەوەکان هەڵتبژارد، ئەگەر هەڵتبژارد بۆ ئەوەی بەجێیان بهێڵیت.','Who on our team has access'=>'کام لە تیمەکەمان','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'ئەندامانی تیمەکەمان دەتوانن زانیاریە بەردەستەکانمان بدەنێ. بۆ نموونە، هەردوو بەڕێوەبەر و بەڕێوەبەری دۆکان دەتوانن دەستگەیشتنیان هەبێت:','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'زانیاری داوا بکە وەک ئەوەی کڕدراوە، کاتێک کڕدرا بۆ لەکوێ بنێردرێت، و','Customer information like your name, email address, and billing and shipping information.'=>'زانیاری کڕیار وەک ناو، ناونیشانی ئیمەیل، و زانیاری وەسل و بارکردن.','Our team members have access to this information to help fulfill orders, process refunds and