ancelled orders'=>'ڕاگرتن (هێشتنەوە)ی داواکارییە ڕەتکراوەکان','Account endpoints'=>'کۆتاخاڵەکانی هەژمار','Privacy policy'=>'سیاسەتی تایبەتێتی','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'زانیارییە کەسییەکانت بەکاردەهێنرێت بۆ پێشکەشکردنی ئەزموونێکی باشتر لە ناو ئەم ماڵپەڕە، بەڕێوەبردنی توانای دەستپێگەیشتن بۆ هەژمارەکەت، هەروەها چەند هۆکارێکی تر کە باسکراون لە پەڕەی %s.','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'زانیارییە کەسییەکانت بەکاردەهێنرێت بۆ جێبەجێکردن و گەیاندنی داواکارییەکەت، پێشکەشکردنی ئەزموونێکی باشتر لە ناو ئەم ماڵپەڕە، هەروەها چەند هۆکارێکی تر کە باسکراون لە پەڕەی %s.','privacy page'=>'پەڕەی تایبەتێتی','Removed personal data from %s order.'=>'دراوەی تاکەکەسیی %s داواکاری سڕایەوە.' . "\0" . 'دراوەی تاکەکەسیی %s داواکاری سڕانەوە.','Allowed emails'=>'پۆستی ئەلیکترۆنییە ڕێگەپێدراوەکان','Filter by registered customer'=>'پاڵاوتن بەپێی کڕیاری تۆمارکراو','Remove personal data'=>'سڕینەوەی دراوەی تاکەکەسی','Accounts &amp; Privacy'=>'هەژمارەکان و تایبەتێتی','Account erasure requests'=>'داواکارییەکانی سڕینەوەی هەژمار','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'ئەم بەشە کۆنترۆڵی دەرکەوتنی سیاسەتی تایبەتێتیی ماڵپەڕەکەت دەکات. ئاگادارییەکانی خوارەوە دەرناکەون تا %s ڕێکنەخرێت.','Registration privacy policy'=>'سیاسەتی تایبەتێتیی تۆمارکردن','Optionally add some text about your store privacy policy to show on account registration forms.'=>'ئارەزوومەندانە هەندێک دەق زیادبکە بۆ سیاسەتی تایبەتێتیی فرۆشگاکەت بۆ پیشاندان لە فۆڕمەکانی تۆمارکردنی هەژمار.','Checkout privacy policy'=>'سیاسەتی تایبەتێتیی پارەدان','Optionally add some text about your store privacy policy to show during checkout.'=>'ئارەزوومەندانە هەندێک دەق زیادبکە دەربارەی سیاسەتی تایبەتێتیی فرۆشگاک