es inclusive of tax'=>'بەڵێ، نرخەکان بە باجەوە دەنووسم','Action event'=>'ڕووداوی کردار','Including tax'=>'بە باجەوە','Excluding tax'=>'بەبێ باج','Round tax at subtotal level, instead of rounding per line'=>'خڕکردنەوەی باج لەسەر ئاستی لاسەرجەم، لەجیاتیی خڕکردنەوە لە هەر دێڕێک','Optionally control which tax class shipping gets, or leave it so shipping tax is based on the cart items themselves.'=>'ئارەزوومەندانە کۆنترۆڵی ئەوە بکە چ پۆلی باجێک گەیاندن بەدەستی دەهێنێت، یان بەجێیبهێڵە بۆ ئەوەی باجی گەیاندن لەسەر کاڵاکانی سەبەتەکە بێت.','This option determines which address is used to calculate tax.'=>'ئەم هەڵبژاردەیە بڕیار لەوە دەدات چ ناونیشانێک بەکاربهێنرێت بۆ هەژمارکردنی باج.','No, I will enter prices exclusive of tax'=>'نەخێر، نرخەکان داخڵ دەکەم بەبێ باج','Choose whether or not this tax rate also gets applied to shipping.'=>'هەڵبژێرە کە ئایا ئەم ڕێژەی باجە بەکاردەبرێت بۆ گەیاندن یان نا.','Choose whether or not this is a compound rate. Compound tax rates are applied on top of other tax rates.'=>'هەڵبژێرە کە ئایا ئەمە ڕێژەی ئاوێتەیە یان نا. ڕێژەی باجە ئاوێتەکان بەکاردەبرێن لە سەرووی ڕێژەکانی تری باج.','Choose a priority for this tax rate. Only 1 matching rate per priority will be used. To define multiple tax rates for a single area you need to specify a different priority per rate.'=>'پێشەنگییەک بۆ ئەم ڕێژەی باجە هەڵبژێرە. تەنیا 1 ڕێژەی هاوشێوە بۆ هەر پێشەنگییەک بەکاردەهێنرێت. بۆ پێناسەکردنی چەند ڕێژەیەکی باج بۆ یەک ناوچە پێویستە پێشەنگییەکی جیاواز دیاریبکەیت بۆ هەر ڕێژەیەک.','Enter a name for this tax rate.'=>'ناوێک بۆ ئەم ڕێژەی باجە بنووسە.','Enter a tax rate (percentage) to 4 decimal places.'=>'ڕێژەیەکی باج بنووسە (ڕێژەی سەدی) بۆ 4 شوێنی دەیی.','Enable low stock notifications'=>'چالاککردنی ئاگادارکەرەوەکانی کەمیی بڕ لە کۆگا','This option lets you limit which countries you are willing to sell to.'=>'ئەم هەڵبژاردەیە ڕێگەت پێدەدات ئەو وڵاتانە سنووردار بکەیت کە بەنیازیت بەرهەمەکانتی تێدا بفرۆشیت.','Sell to all countries'=>'فرۆشتن بە سەرجەم وڵاتان','Choose which countries