our shop - this is where your product archive will be.'=>'ئەمە پەڕەی سەرەکیی فرۆشگاکەت دادەنێت - ئەمە ئەو شوێنەیە کە ئەرشیفی بەرهەمەکانتی لێ دەبێت.','The base page can also be used in your <a href="%s">product permalinks</a>.'=>'پەڕە سەرەکییەکە دەکرێت لە <a href="%s">بەستەرە هەمیشەییەکانی بەرهەمیش</a> بەکاربێت.','Add to cart behaviour'=>'چۆنێتیی زیادکردن بۆ سەبەتە','Redirect to the cart page after successful addition'=>'ئاڕاستەکردن بۆ پەڕەی سەبەتەکە دوای زیادکردنێکی سەرکەوتوو','Enable AJAX add to cart buttons on archives'=>'چالاککردنی دوگمەکانی زیادکردن بۆ سەبەتەی (AJAX) لە ئەرشیفەکان','Measurements'=>'پێوانەکان','Weight unit'=>'یەکەی کێش','This controls what unit you will define weights in.'=>'ئەمە کۆنترۆڵی ئەوە دەکات کە بە چ یەکەیەک کێش دەپێویت.','Dimensions unit'=>'یەکەی دوورییەکان','This controls what unit you will define lengths in.'=>'ئەمە کۆنترۆڵی ئەوە دەکات کە بە چ یەکەیەک درێژییەکان دەپێویت.','Show "verified owner" label on customer reviews'=>'پیشاندانی نیشانەی "خاوەنی سەلمێنراو" لەسەر پێداچوونەوەی کڕیاران','Product ratings'=>'هەڵسەنگاندنەکانی بەرهەم','Manage stock'=>'بەڕێوەبردنی کۆگا','Enable stock management'=>'چالاککردنی بەڕێوەبردنی کۆگا','Hold stock (minutes)'=>'ڕاگرتنی کۆگا (خولەک)','Hold stock (for unpaid orders) for x minutes. When this limit is reached, the pending order will be cancelled. Leave blank to disable.'=>'ڕاگرتنی کۆگا (بۆ ئەو داواکارییانەی پارەکانیان نەدراوە) بۆ x خولەک. کاتێک ئەم ماوەیە تەواوبوو، داواکارییەکە لەدۆخی چاوەڕوانییەوە دەگۆڕدرێت بۆ ڕەتکراوە. بەبەتاڵیی بەجێیبهێڵە بۆ ناچالاککردن.','Notifications'=>'ئاگادارکەرەوەکان','Enable out of stock notifications'=>'چالاککردنی ئاگادارکەرەوەکانی تەواوبوونی بڕ لە کۆگا','Notification recipient(s)'=>'وەرگری ئاگاداری','Low stock threshold'=>'لێواری کەمی بڕ لە کۆگا','Out of stock threshold'=>'لێواری تەواوبوونی بڕ لە کۆگا','Out of stock visibility'=>'لەبەرچاویی "بەردەست نییە لە کۆگا"','Hide out of stock items from the catalog'=>'شاردنەوەی ئەو بەرهەمانەی بڕەکانیان لە کۆگا تەواو بووە','Stock display 